                    let wordIndex = Math.round(Math.random() * dictionary.length);
                    let word = dictionary[wordIndex];
                    dictionary.splice(wordIndex, 1);
                    document.getElementById("shoutouttohisfamily").innerText = "Skud ud til " + word;
